DELIMITER $$
CREATE TRIGGER `after_order_insert` AFTER INSERT ON `pesanan` FOR EACH ROW BEGIN
        -- Insert a new notification for the user
        INSERT INTO notifikasi (id_user, id_pesanan, status_pesanan)
        VALUES (NEW.id_user, NEW.id_pesanan, NEW.status_pesanan);
        
        -- Delete the oldest notification if the count exceeds 8
        SET @notification_count = (
            SELECT COUNT(*) FROM notifikasi WHERE id_user = NEW.id_user
        );
        IF @notification_count >= 8 THEN
            DELETE FROM notifikasi WHERE id_user = NEW.id_user
            ORDER BY timestamp_notif ASC LIMIT 1;
        END IF;
END
$$
DELIMITER ;
DELIMITER $$
CREATE TRIGGER `after_order_update` AFTER UPDATE ON `pesanan` FOR EACH ROW BEGIN
    -- Check if the order status changed to 1 or 2 (being delivered or order complete)
